searchIndex["w_result"] = {"doc":"Defines `WResult`, a result type that carries warnings.","items":[[4,"WResult","w_result","A result type that carries warnings.",null,null],[13,"WOk","","Contains the success value along with any accumulated warnings.",0,null],[13,"WErr","","Contains the error value.",0,null],[11,"fmt","","",0,{"inputs":[{"name":"wresult"},{"name":"formatter"}],"output":{"name":"result"}}],[11,"clone","","",0,{"inputs":[{"name":"wresult"}],"output":{"name":"wresult"}}],[11,"hash","","",0,null],[11,"eq","","",0,{"inputs":[{"name":"wresult"},{"name":"wresult"}],"output":{"name":"bool"}}],[11,"ne","","",0,{"inputs":[{"name":"wresult"},{"name":"wresult"}],"output":{"name":"bool"}}],[11,"is_ok","","Returns true if this `WResult` is `WOk`",0,{"inputs":[{"name":"wresult"}],"output":{"name":"bool"}}],[11,"is_err","","Returns true if this `WResult` is `WErr`",0,{"inputs":[{"name":"wresult"}],"output":{"name":"bool"}}],[11,"is_warn_or_err","","Returns true if this `WResult` is `WErr` or if it is `WOk` but contains warnings.",0,{"inputs":[{"name":"wresult"}],"output":{"name":"bool"}}],[11,"ok_discard","","Converts this `WResult` to an `Option` by taking the taking the `WOk` value or mapping\n`WErr` to `None`. Any warnings are discarded.",0,{"inputs":[{"name":"wresult"}],"output":{"name":"option"}}],[11,"err","","Converts this `WResult` to an `Option` by taking the `WErr` variant or mapping `WOk` to\n`None`.",0,{"inputs":[{"name":"wresult"}],"output":{"name":"option"}}],[11,"ok_werr","","Converts this `WResult` to an `Option` by taking the `WOk` variant or mapping `WErr` to\n`None`. This function is similar to `ok_discard` except if there are any warnings then they\nare treated as errors and this function returns `None`.",0,{"inputs":[{"name":"wresult"}],"output":{"name":"option"}}],[11,"map","","Map the `WOk` value of this `WResult`, if any.",0,{"inputs":[{"name":"wresult"},{"name":"f"}],"output":{"name":"wresult"}}],[11,"map_err","","Map the `WErr` value of this `WResult`, if any.",0,{"inputs":[{"name":"wresult"},{"name":"f"}],"output":{"name":"wresult"}}],[11,"map_warnings","","Map the warnings of this `WResult`.",0,{"inputs":[{"name":"wresult"},{"name":"f"}],"output":{"name":"wresult"}}],[11,"and","","If `self` is `WOk`, returns `res` with the warnings from `self` accumulated into the final\nresult. Otherwise returns the `WErr` value of `self`.",0,{"inputs":[{"name":"wresult"},{"name":"wresult"}],"output":{"name":"wresult"}}],[11,"and_then","","If `self` is `WOk`, returns the result of applying `op` to `self`&#39;s value and warnings.\nOtherwise returns the `WErr` value of `self`.",0,{"inputs":[{"name":"wresult"},{"name":"f"}],"output":{"name":"wresult"}}],[11,"or","","If `self` is `WOk` returns `self`. Otherwise returns `res`.",0,{"inputs":[{"name":"wresult"},{"name":"wresult"}],"output":{"name":"wresult"}}],[11,"or_else","","If `self` is `WOk` returns `self`. Otherwise returns the result of applying `op` to\n`self`&#39;s error value.",0,{"inputs":[{"name":"wresult"},{"name":"f"}],"output":{"name":"wresult"}}],[11,"result_discard","","Convert this `WResult&lt;T, W, E&gt;` to a `Result&lt;T, E&gt;`, discarding any errors. See also\n`result_log` for a version of this function that logs warnings.",0,{"inputs":[{"name":"wresult"}],"output":{"name":"result"}}],[11,"result_werr_res","","Convert this `WResult&lt;T, W, E&gt;` to a `Result&lt;T, Result&lt;W, E&gt;&gt;`. This is a way to convert\nfrom `WResult` to `Result`, treating warnings as errors but allowing `W` and `E` to be two\ndifferent types. See also `result_werr` for when `W` and `E` are the same type. If there\nare multiple warnings the first is returned.",0,{"inputs":[{"name":"wresult"}],"output":{"name":"result"}}],[11,"unwrap_discard_or","","If `self` is `WOk`, unwraps it discarding any warnings. Otherwise returns `optb`. See also\n`unwrap_log_or` for a version of this function that logs warnings.",0,{"inputs":[{"name":"wresult"},{"name":"t"}],"output":{"name":"t"}}],[11,"unwrap_or_werr","","If `self` is `WOk` and has no warnings, unwraps it. Otherwise returns `optb`.",0,{"inputs":[{"name":"wresult"},{"name":"t"}],"output":{"name":"t"}}],[11,"unwrap_discard_or_else","","If `self` is `WOk`, unwraps it discarding any warnings. Otherwise returns the result of\napplying `op` to `self`&#39;s error value. See also `unwrap_log_or_else` for a version of this\nfunction that logs warnings.",0,{"inputs":[{"name":"wresult"},{"name":"f"}],"output":{"name":"t"}}],[11,"err_werr","","Take the error value of this `WResult`, if any. Otherwise returns the first warning, if\nany. This function is the same as `WResult::err` except that warnings are treated as\nerrors.",0,{"inputs":[{"name":"wresult"}],"output":{"name":"option"}}],[11,"result_werr","","Convert this `WResult` to a `Result` but treat warnings as errors. If there are multiple\nwarnings the first is returned.",0,{"inputs":[{"name":"wresult"}],"output":{"name":"result"}}],[11,"unwrap_or_else_werr","","If `self` is `WOk` and has no warnings then unwrap it. Otherwise return the result of\napplying `op` to `self`&#39;s error or first warning.",0,{"inputs":[{"name":"wresult"},{"name":"f"}],"output":{"name":"t"}}],[11,"ok_log","","Take the `WOk` value of `self`, if any. Warnings are logged using the `warn!` macro before\nbeing discarded.",0,{"inputs":[{"name":"wresult"}],"output":{"name":"option"}}],[11,"result_log","","Convert this `WResult&lt;T, W, E&gt;` to a `Result&lt;T, E&gt;`. Warnings are logged using the `warn!`\nmacro before being discarded.",0,{"inputs":[{"name":"wresult"}],"output":{"name":"result"}}],[11,"unwrap_log_or","","If `self` is `WOk`, unwrap it and log any warnings using the `warn!` macro. Otherwise\nreturn `optb`.",0,{"inputs":[{"name":"wresult"},{"name":"t"}],"output":{"name":"t"}}],[11,"unwrap_log_or_else","","If `self` is `WOk`, unwrap it and log any warnings using the `warn!` macro. Otherwise\nreturn the result of applying `op` to `self`&#39;s error value.",0,{"inputs":[{"name":"wresult"},{"name":"f"}],"output":{"name":"t"}}],[11,"from","","",0,{"inputs":[{"name":"result"}],"output":{"name":"wresult"}}],[11,"from_iter","","",0,{"inputs":[{"name":"i"}],"output":{"name":"self"}}]],"paths":[[4,"WResult"]]};
